import '../Style.css';
import ChildComponent from './ChildComponent';
import { useEffect } from 'react';
import io from 'socket.io-client';

function App() {
  useEffect(() => {
    const socket = io('http://localhost:300'); // Remplacez l'URL par votre URL de serveur Socket.IO
    socket.on('connect', () => {
      console.log('Connecté au serveur Socket.IO');
    });
    return () => {
      socket.disconnect(); // Déconnexion du serveur Socket.IO lorsque le composant est démonté
    };
  }, []);

  return (
    <div className="App">
      <p className='Coucou'>COUCOUc</p>
      <ChildComponent />
    </div>
  );
}

export default App;
